const Test = () => {
	const [state, setState] = useState(true);

	useEffect(() => {
		console.log(123);
	}, []);

	return (
		<button
			onClick={() => {
				setState(!state);
			}}
		>
			{state}
		</button>
	);
};

export default Test;
